import React from "react";
import {Field, reduxForm} from "redux-form";
import {NavLink} from "react-router-dom";
import './SignUpReduxForm.css'

const SignUpForm = (props) => {
    return <form onSubmit={props.handleSubmit}>
        <div className="field">
            <Field className={"input"} placeholder={"First Name"} name={"firstName"}
                   component={"input"}/>
        </div>
        <div className="field">
            <Field className={"input"} placeholder={"Last Name"} name={"lastName"}
                   component={"input"}/>
        </div>
        <div className="field">
            <Field className={"input"} placeholder={"Email"} name={"email"} component={"input"}/>
        </div>
        <div className="field">
            <Field className={"input"} type={"password"} placeholder={"Password"} name={"password"}
                   component={"input"}/>
        </div>
        <div className="signUpIconWrapper">
                <button>ВОЙТИ</button>
        </div>
        <div>
            Already have an account?
            <NavLink to="/">
                <button>Sign in</button>
            </NavLink>
        </div>
    </form>
};

const SignUpReduxForm = reduxForm({
    form: 'login'
})(SignUpForm);

export default SignUpReduxForm
